[Form]
public class ProjInvoiceProposalListPage extends FormRun
{
    private boolean enhanceInvoiceProposalLinePerf;

}

/// <summary>
/// Initialize the company lookup value to be this LE.
/// </summary>
public void init()
{
    enhanceInvoiceProposalLinePerf = ProjProposalTranSummariesRefresh::isInvoiceProposalLineEditPerfEnabled() ? true : false;

    super();

    if (element.args().dataset() == tableNum(ProjInvoiceTable))
    {
        ProjInvoiceTable projInvoiceTable = element.args().record();

        if (projInvoiceTable && PSAContractLineItems::hasBillingRules(projInvoiceTable.ProjInvoiceProjId))
        {
            PSAProjProposalSelection.visible(false);
        }
    }

    ProjProposalJour_RecalculateTotalsStatus.enabled(enhanceInvoiceProposalLinePerf);
    ProjProposalJour_RecalculateTotalsStatus.visible(enhanceInvoiceProposalLinePerf);

    CtrlCompanyLookup.text(curExt());

    boolean projOperationsIntegrationFeatureEnabled = ProjProjectOperationsIntegrationFeatureHelper::isFeatureEnabled();
    if(projOperationsIntegrationFeatureEnabled)
    {
        NewMenuButton.visible(false);
        NewMenuButton.enabled(false);
        CtrlCancel.visible(false);
        CtrlCancel.enabled(false);
        PrintMgmt.visible(false);
        PrintMgmt.enabled(false);
    }

    ProjParameters projParameters = ProjParameters::find();
    InvoiceSummary.visible(projParameters.ShowInvoiceSummary);

    // <GTE>
    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxTmpWorkProjectInvoiceProposal.visible(false);
    }
    // </ GTE>
}

public void jumpRef()
{
    if (ProjProjectOperationsIntegrationFeatureHelper::isFeatureEnabled())
    {
        ProjectOperationsDWHelper dw = ProjectOperationsDWHelper::construct();
        dw.openProjectContractDetailsInCE(projProposalJour.ProjInvoiceProjId, projProposalJour.DataAreaId);
    }
    else
    {
        super();
    }
}

void clicked()
{
    Args args = new Args(formStr(ProjInvoiceProposalCreateLines));
    FormRun formRun;

    args.caller(element);
    args.openMode(OpenMode::New);
    args.copyCallerQuery(CopyCallerQuery::No);
    formRun = classfactory.formRunClass(args);
    formRun.init();
    formRun.run();
    formRun.wait();
}

